import React, { useState, useEffect } from "react"
import axios from "axios"
import styled from "@emotion/styled"
// import WeatherCard from "./components/WeatherCard/component"
// import { isElementOfType } from "react-dom/test-utils"
import UserTable from "./components/users/userTable"
import Toolbar from "./components/Toolbar/Toolbar"

function App() {
  const [userList, setUserList] = useState([])

  const requestOptions = {
    method: "get",
    url:
      "https://j1e3j8uqpd.execute-api.eu-west-1.amazonaws.com/dev/get-user/8912",
    // data: params,
  }

  const data = async () => {
    const apiResult = await axios(requestOptions)
    const result = await apiResult
    return result
  }

  useEffect(() => {
    data().then((res) => {
      if (200 === res.status) {
        console.log(res.data)
        setUserList(res.data)
      } else if (400 === res.status) {
        console.log(res.data)
      }
    })
  }, [])

  let toolBarItems = {
    logo: "",
    navItemList: [
      { reference: "/", name: "Products" },
      { reference: "/", name: "Users" },
    ],
  }

  const App = styled.div`
    margin: 0 auto;

    color: black;
  `

  return (
    <App>
      <Toolbar toolBarItems={toolBarItems} />
      <UserTable userList={userList} />
      {/* <h1>The user is {userList}</h1> */}
      {/* <WeatherCard temperature={-20} /> */}
    </App>
  )
}

export default App
